import React from 'react';

import Card from '../Card/Card';
import classes from './Feira.module.css';

const feira = ( props ) => {
    const footer = props.data;

    return (
        <Card 
            img={props.img}
            nome={props.nome} 
            descr={props.descr}
            footer={footer}
        />
    );
};

export default feira;
